import React, { useState } from 'react';
import logo from "./images/logo.jpeg";


const App = () => {
    const [note, setNote] = useState({
        title: "",
        content: ""
    });
    const inputEvent = (e) => {
        e.preventDefault();
        let value = e.target.value;
        const name = e.target.name;

        setNote((oldData) => {
            return {
                ...oldData,
                [name]:value,
            };

        });

    };


    return <>
        <div className="header">
            <div className="logo">
                <img src={logo} alt="logo" />
                <h1>Google Keep</h1>
            </div>
            <div className="info">
                <ol>
                    <li>Create Account</li>
                    <li>Sign In</li>
                </ol>
            </div>
        </div>

        <div className="main_note">
            <form>
                <div className="input">
                    <input type="text" name="title" value={note.title} onChange={inputEvent} placeholder="Title" />
                    <textarea name="content" value={note.content} rows="" cols="" placeholder="Write a note..." />
                </div>
                <button>+</button>

            </form>
        </div>

        <div className="notes">
            <div className="notes_list">
                <div className="card">
                    <h1>Title</h1>

                    <div>This is the content</div>
                </div>
                <button>X</button>
            </div>

        </div>
    </>

}
export default App;
